INSERT INTO `pols_hotel` VALUES (1,'Отель Нева','Санкт-Петербург','Санкт-Петербург, Невский проспект, 10',3,3.6,4,'Гостиница \"Нева\" предлагает роскошные номера с панорамным видом на реку и исторический центр города. Насладитесь изысканным интерьером в стиле северной столицы, посетите наш ресторан с авторской кухней и расслабьтесь в спа-центре с хамамом после долгой прогулки по городу.','pols/images/hotels/Saint_Petersburg/hotel_1/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_1/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_1/(3).webp','pols/images/hotels/Saint_Petersburg/hotel_1/(4).webp','pols/images/hotels/Saint_Petersburg/hotel_1/(5).webp'),(2,'Гранд Петербург','Санкт-Петербург','Санкт-Петербург, ул. Морская, 25',4,3.8,5,'Гостиница \"Гранд Петербург\" расположена в сердце культурной столицы. Уникальное сочетание классического петербургского стиля и современных технологий создает неповторимую атмосферу. В вашем распоряжении просторные люксы, конференц-залы, фитнес-центр и эксклюзивные экскурсионные программы.','pols/images/hotels/Saint_Petersburg/hotel_2/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_2/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_2/(3).webp','pols/images/hotels/Saint_Petersburg/hotel_2/(4).webp','pols/images/hotels/Saint_Petersburg/hotel_2/(5).webp'),(3,'Черноморская Ривьера','Сочи','Сочи, ул. Курортная, 15',3,3.9,4,'Гостиница \"Черноморская Ривьера\" - это настоящий курортный оазис с собственным песчаным пляжем, тропическим садом и тремя бассейнами. Насладитесь средиземноморской кухней в нашем ресторане, попробуйте талассотерапию в спа-центре и проведите незабываемый отпуск в комфортабельных номерах с видом на море.','pols/images/hotels/Sochi/hotel_1/(1).webp','pols/images/hotels/Sochi/hotel_1/(2).webp','pols/images/hotels/Sochi/hotel_1/(3).webp','pols/images/hotels/Sochi/hotel_1/(4).webp','pols/images/hotels/Sochi/hotel_1/(5).webp'),(4,'Олимпийский','Сочи','Сочи, Олимпийский проспект, 32',2,3.9,3,'Гостиница \"Олимпийский\" расположена в непосредственной близости от олимпийских объектов. Современные номера с панорамными окнами, инновационный фитнес-центр с тренажерами последнего поколения и крытый бассейн с подогревом делают наш отель идеальным выбором для активного отдыха.','pols/images/hotels/Sochi/hotel_2/(1).webp','pols/images/hotels/Sochi/hotel_2/(2).webp','pols/images/hotels/Sochi/hotel_2/(3).webp','pols/images/hotels/Sochi/hotel_2/(4).webp','pols/images/hotels/Sochi/hotel_2/(5).webp'),(5,'Красная Площадь','Москва','Москва, ул. Тверская, 1',4,3.8,5,'Гостиница \"Красная Площадь\" - это элегантный пятизвездочный отель в двух шагах от главных достопримечательностей столицы. Роскошные интерьеры, ресторан с мишленовской кухней, персональный консьерж-сервис и эксклюзивные экскурсионные программы подарят вам неповторимый опыт пребывания в Москве.','pols/images/hotels/Moscow/hotel_1/(1).webp','pols/images/hotels/Moscow/hotel_1/(2).webp','pols/images/hotels/Moscow/hotel_1/(3).webp','pols/images/hotels/Moscow/hotel_1/(4).webp','pols/images/hotels/Moscow/hotel_1/(5).webp'),(6,'Золотое Кольцо','Москва','Москва, Смоленская площадь, 5',3,4,4,'Гостиница \"Золотое Кольцо\" сочетает в себе традиции русского гостеприимства и современный комфорт. Из окон наших номеров открывается потрясающий вид на Москву-сити и исторический центр. Посетите наш ресторан с панорамной террасой, где подают блюда русской кухни в авторской интерпретации.','pols/images/hotels/Moscow/hotel_2/(1).webp','pols/images/hotels/Moscow/hotel_2/(2).webp','pols/images/hotels/Moscow/hotel_2/(3).webp','pols/images/hotels/Moscow/hotel_2/(4).webp','pols/images/hotels/Moscow/hotel_2/(5).webp'),(7,'Казанская Усадьба','Казань','Казань, ул. Баумана, 30',2,4,3,'Гостиница \"Казанская Усадьба\" расположена в старинном особняке XIX века в пешей доступности от Казанского Кремля. Уникальный интерьер сочетает татарские национальные мотивы и современный дизайн. В нашем чайном домике вы сможете попробовать традиционные татарские сладости и ароматный чай по старинным рецептам.','pols/images/hotels/Kazan/hotel_1/(1).webp','pols/images/hotels/Kazan/hotel_1/(2).webp','pols/images/hotels/Kazan/hotel_1/(3).webp','pols/images/hotels/Kazan/hotel_1/(4).webp','pols/images/hotels/Kazan/hotel_1/(5).webp'),(8,'Волга','Казань','Казань, набережная реки Казанки, 12',4,3.6,4,'Гостиница \"Волга\" - это современный комплекс с видом на реку и город. Насладитесь просторными номерами с панорамными окнами, посетите наш аквапарк с термальными источниками, попробуйте блюда татарской и европейской кухни в ресторане на 25-м этаже с вращающейся площадкой.','pols/images/hotels/Kazan/hotel_2/(1).webp','pols/images/hotels/Kazan/hotel_2/(2).webp','pols/images/hotels/Kazan/hotel_2/(3).webp','pols/images/hotels/Kazan/hotel_2/(4).webp','pols/images/hotels/Kazan/hotel_2/(5).webp'),(9,'Анапа Марин','Анапа','Анапа, ул. Набережная, 5',3,4,3,'Гостиница \"Анапа Марин\" - это идеальное место для семейного отдыха на берегу Черного моря. Собственный песчаный пляж, аквапарк с горками для детей и взрослых, анимационные программы и ресторан с детским меню сделают ваш отпуск по-настоящему незабываемым. Все номера оформлены в морском стиле с балконами или террасами.','pols/images/hotels/Anapa/hotel_1/(1).webp','pols/images/hotels/Anapa/hotel_1/(2).webp','pols/images/hotels/Anapa/hotel_1/(3).webp','pols/images/hotels/Anapa/hotel_1/(4).webp','pols/images/hotels/Anapa/hotel_1/(5).webp'),(10,'Солнечный Берег','Анапа','Анапа, Пионерский проспект, 20',2,3.9,4,'Гостиница \"Солнечный Берег\" окружена тенистым парком с редкими растениями. Наш комплекс включает в себя SPA-центр с талассотерапией, несколько бассейнов с морской водой, теннисные корты и школу дайвинга. По вечерам гостей ждут живые концерты на открытой площадке у моря.','pols/images/hotels/Anapa/hotel_2/(1).jpg','pols/images/hotels/Anapa/hotel_2/(2).jpg','pols/images/hotels/Anapa/hotel_2/(3).webp','pols/images/hotels/Anapa/hotel_2/(4).webp','pols/images/hotels/Anapa/hotel_2/(5).webp'),(11,'Дон Плаза','Ростов-на-Дону','Ростов-На-Дону, ул. Большая Садовая, 115',4,4,4,'Гостиница \"Дон Плаза\" - это бизнес-отель премиум-класса в деловом центре города. К вашим услугам современные конференц-залы, бизнес-центр с профессиональным оборудованием, лаунж-зона для переговоров и ресторан европейской кухни. После рабочего дня расслабьтесь в нашем спа-комплексе с крытым бассейном.','pols/images/hotels/Rostov_Na_Donu/hotel_1/(1).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/(3).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/(4).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/(5).webp'),(12,'Тихий Дон','Ростов-на-Дону','Ростов-На-Дону, набережная Дона, 42',3,4.1,3,'Гостиница \"Тихий Дон\" расположена в живописном месте на берегу реки. Интерьеры отеля вдохновлены казачьими традициями - деревянная резьба, ручная роспись и антикварная мебель создают уникальную атмосферу. В нашем ресторане подают блюда донской кухни, приготовленные по старинным рецептам.','pols/images/hotels/Rostov_Na_Donu/hotel_2/(1).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/(3).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/(4).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/(5).webp'),(13,'Волжские Зори','Нижний Новгород','Нижний Новгород, ул. Рождественская, 8',2,4,3,'Гостиница \"Волжские Зори\" находится в историческом здании XIX века в самом сердце старого города. Аутентичные интерьеры с сохраненными деталями - кирпичная кладка, деревянные балки и старинные светильники - сочетаются с современным комфортом. На крыше отеля расположена смотровая площадка с лучшим видом на Стрелку.','pols/images/hotels/Nizhny_Novgorod/hotel_1/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/(3).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/(4).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/(5).webp'),(14,'Нижегородский','Нижний Новгород','Нижний Новгород, пл. Минина и Пожарского, 2',4,3.9,5,'Гостиница \"Нижегородский\" - это современный небоскреб с панорамным видом на слияние Оки и Волги. В отеле представлены номера различных категорий, включая президентские люксы с личным батлером. На 50-м этаже расположен ресторан \"Высота\" с авторской кухней и вращающейся площадкой, откуда открывается вид на 360 градусов.','pols/images/hotels/Nizhny_Novgorod/hotel_2/(1).jpg','pols/images/hotels/Nizhny_Novgorod/hotel_2/(2).jpg','pols/images/hotels/Nizhny_Novgorod/hotel_2/(3).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/(4).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/(5).webp'),(15,'Геленджик Бэй','Геленджик','Геленджик, ул. Ленина, 10',3,3.9,4,'Гостиница \"Геленджик Бэй\" расположена на первой линии у моря в окружении реликтового можжевелового леса. Наш комплекс включает частный галечный пляж, SPA-центр с термами, несколько ресторанов с кухней разных народов мира и собственный яхт-клуб с возможностью аренды катеров для морских прогулок.','pols/images/hotels/Gelendzhik/hotel_1/(1).webp','pols/images/hotels/Gelendzhik/hotel_1/(2).webp','pols/images/hotels/Gelendzhik/hotel_1/(3).webp','pols/images/hotels/Gelendzhik/hotel_1/(4).webp','pols/images/hotels/Gelendzhik/hotel_1/(5).webp'),(16,'Приморская','Геленджик','Геленджик, Приморский бульвар, 7',2,4,3,'Гостиница \"Приморская\" - это уютный бутик-отель в стиле прованс с тенистым садом и бассейном. Каждый номер оформлен в индивидуальном стиле с использованием натуральных материалов. По утрам гостей ждет завтрак с домашней выпечкой и свежими фруктами из нашего сада, а по вечерам - дегустации местных вин на террасе с видом на закат.','pols/images/hotels/Gelendzhik/hotel_2/(1).webp','pols/images/hotels/Gelendzhik/hotel_2/(2).webp','pols/images/hotels/Gelendzhik/hotel_2/(3).webp','pols/images/hotels/Gelendzhik/hotel_2/(4).webp','pols/images/hotels/Gelendzhik/hotel_2/(5).webp');
