INSERT INTO `pols_rooms` VALUES (1,'Стандарт с видом на город',1,1,18,'Утренний свет, льющийся через высокие окна, раскрывает панораму исторического центра - крыши старинных зданий, купола соборов и бесконечное небо Северной столицы. Интерьер в сдержанных серо-бежевых тонах с деревянными акцентами создает ощущение уюта и спокойствия. Вечером, когда за окном зажигаются огни, номер превращается в идеальное убежище для созерцания городской жизни.',2800.00,'pols/images/hotels/Saint_Petersburg/hotel_1/1/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_1/1/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_1/1/(3).webp',1),(2,'Двухместный Делюкс',2,1,25,'Просторный номер, где классическая петербургская элегантность встречается с современным комфортом. Высокие потолки с лепниной, паркет, мерцающий в свете торшера, и большие окна, открывающие вид на Невский проспект - здесь чувствуется пульс города. Особое очарование придает каминная зона с парой кресел, где так приятно провести вечер с книгой.',4200.00,'pols/images/hotels/Saint_Petersburg/hotel_1/2/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_1/2/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_1/2/(3).webp',1),(3,'Семейный номер',3,1,32,'Теплый свет торшеров, мягкие пледы на кроватях и деревянные игрушки в углу - этот номер создан для семейного отдыха. Дети будут в восторге от собственного уголка с книжками и играми, а родители оценят удобную планировку и умиротворяющий вид на тихий зеленый двор. По вечерам здесь особенно уютно собираться всей семьей у большого круглого стола.',3800.00,'pols/images/hotels/Saint_Petersburg/hotel_1/3/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_1/3/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_1/3/(3).webp',1),(4,'Люкс с видом на Неву',2,2,38,'Широкие окна от пола до потолка открывают захватывающий вид на Неву и городские набережные. Интерьер в стиле modern classic - темный дуб, кашемировые оттенки, мраморные поверхности. Отдельная гостиная с камином и библиотекой создает атмосферу респектабельного петербургского особняка. Особого внимания заслуживает ванная комната с панорамным видом на воду.',6500.00,'pols/images/hotels/Saint_Petersburg/hotel_1/4/(1).png','pols/images/hotels/Saint_Petersburg/hotel_1/4/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_1/4/(3).webp',1),(5,'Апартаменты Премиум',4,2,40,'Просторные апартаменты напоминают элитную городскую квартиру с открытой планировкой. Кухня с барной стойкой перетекает в гостиную с панорамными окнами, откуда открывается вид на исторический центр. Спальни с кроватями размера king-size и гардеробными создают ощущение домашнего уюта. Идеальное решение для тех, кто ценит простор и независимость.',7800.00,'pols/images/hotels/Saint_Petersburg/hotel_1/5/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_1/5/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_1/5/(3).webp',1),(6,'Императорский люкс',3,2,42,'Роскошь царских времен в современной интерпретации: хрустальные люстры, отражающиеся в зеркалах, антикварная мебель с позолотой, гобелены на стенах. Из окон открывается вид на главные достопримечательности города. Ванная комната с мраморной отделкой и ванной на львиных ножках переносит в эпоху императорских балов.',8000.00,'pols/images/hotels/Saint_Petersburg/hotel_1/6/(1).png','pols/images/hotels/Saint_Petersburg/hotel_1/6/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_1/6/(3).webp',1),(7,'Классический стандарт',1,1,16,'Номер в духе старинных петербургских гостиных: высокие потолки с лепниной, дубовый паркет, тяжелые портьеры на окнах. Утром солнечный свет, проникая сквозь витражные стекла, рисует на стенах причудливые узоры. Особый шарм придает каминная полка с коллекционными книгами и старинными часами.',3200.00,'pols/images/hotels/Saint_Petersburg/hotel_2/1/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_2/1/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_2/1/(3).webp',2),(8,'Улучшенный двухместный',2,1,22,'Светлый номер с двумя удобными кроватями и зоной для чтения у окна. Интерьер сочетает классическую строгость с современным комфортом: деревянные панели на стенах, кожаные кресла, торшеры с теплым светом. Ванная комната с мозаичным полом и дождевым душем добавляет нотку роскоши.',4500.00,'pols/images/hotels/Saint_Petersburg/hotel_2/2/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_2/2/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_2/2/(3).webp',2),(9,'Гранд Люкс',2,2,35,'Просторный номер с зоной гостиной, где высокие зеркала в позолоченных рамах визуально расширяют пространство. Камин с мраморным порталом становится центром композиции, вокруг которого расставлены бархатные диваны. Из окон открывается вид на городские крыши и шпили соборов - настоящая открыточная панорама Петербурга.',7200.00,'pols/images/hotels/Saint_Petersburg/hotel_2/3/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_2/3/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_2/3/(3).webp',2),(10,'Номер с балконом',1,1,20,'Уникальный номер с собственным балконом, где можно наблюдать за жизнью города с высоты. Утром - с чашкой кофе встречать рассвет, днем - любоваться архитектурой, вечером - провожать закат с бокалом вина. Интерьер в светлых тонах с деревянными акцентами создает ощущение легкости и простора.',4900.00,'pols/images/hotels/Saint_Petersburg/hotel_2/4/(1).webp','pols/images/hotels/Saint_Petersburg/hotel_2/4/(2).webp','pols/images/hotels/Saint_Petersburg/hotel_2/4/(3).webp',2),(11,'Стандарт с видом на море',1,1,18,'Яркий номер в средиземноморском стиле: белые стены, голубые акценты, плетеная мебель. С балкона открывается безграничный вид на Черное море - утром можно наблюдать, как солнце поднимается из-за горизонта, окрашивая воду в золотые оттенки. Вечерний бриз приносит ароматы моря и хвои.',3500.00,'pols/images/hotels/Sochi/hotel_1/1/(1).webp','pols/images/hotels/Sochi/hotel_1/1/(2).webp','pols/images/hotels/Sochi/hotel_1/1/(3).webp',3),(12,'Семейный с террасой',3,1,30,'Просторный номер с собственной террасой, где можно собраться всей семьей за завтраком или вечерними играми. Детский уголок с игрушками и книжками, удобные кровати с ортопедическими матрасами. Вид одновременно на море и горы создает ощущение гармонии и покоя.',5200.00,'pols/images/hotels/Sochi/hotel_1/2/(1).webp','pols/images/hotels/Sochi/hotel_1/2/(2).webp','pols/images/hotels/Sochi/hotel_1/2/(3).webp',3),(13,'Делюкс с джакузи',2,1,25,'Романтический номер с гидромассажной ванной на террасе, откуда открывается панорамный вид на море. Интерьер в теплых бежево-коричневых тонах с мягким освещением создает атмосферу уюта. Особый шарм придают детали - свечи в стеклянных подсвечниках, пледы из натуральной шерсти, живые цветы.',5800.00,'pols/images/hotels/Sochi/hotel_1/3/(1).png','pols/images/hotels/Sochi/hotel_1/3/(2).webp','pols/images/hotels/Sochi/hotel_1/3/(3).webp',3),(14,'Бунгало у бассейна',2,1,28,'Уединенное бунгало в тропическом саду с прямым выходом к бассейну. Интерьер в колониальном стиле: темное дерево, белые ткани, плетеные элементы. Собственная терраса с шезлонгами и открытая ванная комната создают ощущение полного единения с природой.',6200.00,'pols/images/hotels/Sochi/hotel_1/4/(1).png','pols/images/hotels/Sochi/hotel_1/4/(2).webp','pols/images/hotels/Sochi/hotel_1/4/(3).webp',3),(15,'Спортивный стандарт',1,1,16,'Динамичный современный номер с панорамными окнами, выходящими на олимпийские объекты. Интерьер в серо-красных тонах с мотивирующими принтами на стенах. Пространство организовано так, чтобы после тренировки можно было удобно расположиться для отдыха и восстановления.',2900.00,'pols/images/hotels/Sochi/hotel_2/1/(1).webp','pols/images/hotels/Sochi/hotel_2/1/(2).webp','pols/images/hotels/Sochi/hotel_2/1/(3).webp',4),(16,'Номер для спортсменов',2,1,22,'Просторный номер с дополнительной зоной для тренировок и хранения инвентаря. Большие зеркала, специальное покрытие пола, система вентиляции - все продумано для комфортного восстановления после нагрузок. Вид на горный кластер вдохновляет на новые достижения.',4100.00,'pols/images/hotels/Sochi/hotel_2/2/(1).webp','pols/images/hotels/Sochi/hotel_2/2/(2).webp','pols/images/hotels/Sochi/hotel_2/2/(3).webp',4),(17,'Люкс с сауной',2,2,32,'Номер с собственной инфракрасной сауной и зоной восстановления. После тренировок здесь можно полностью расслабиться - теплые тона интерьера, мягкое освещение, вид на море. Особое внимание уделено деталям - от эргономичной мебели до системы \"умного климата\".',6800.00,'pols/images/hotels/Sochi/hotel_2/3/(1).webp','pols/images/hotels/Sochi/hotel_2/3/(2).webp','pols/images/hotels/Sochi/hotel_2/3/(3).webp',4),(18,'Олимпийский люкс',3,2,38,'Тематический номер с элементами олимпийской символики в интерьере: факелы, медали, исторические фотографии. Просторная гостиная с мультимедийной зоной, где можно посмотреть записи знаменитых соревнований. Вид одновременно на море и горы напоминает о масштабе олимпийских объектов.',7500.00,'pols/images/hotels/Sochi/hotel_2/4/(1).webp','pols/images/hotels/Sochi/hotel_2/4/(2).webp','pols/images/hotels/Sochi/hotel_2/4/(3).webp',4),(19,'Номер с ледовым видом',1,1,20,'Уникальный номер с панорамным окном, выходящим прямо на ледовую арену. Можно наблюдать за тренировками спортсменов или вспоминать моменты знаменитых хоккейных матчей. Интерьер в холодных сине-белых тонах с элементами, напоминающими ледяные кристаллы.',4800.00,'pols/images/hotels/Sochi/hotel_2/5/(1).webp','pols/images/hotels/Sochi/hotel_2/5/(2).webp','pols/images/hotels/Sochi/hotel_2/5/(3).webp',4),(20,'Классический стандарт',1,1,17,'Номер с видом на исторический центр Москвы, где за окном разворачивается многовековая история. Интерьер в классическом стиле с антикварной мебелью и тяжелыми портьерами. По вечерам, когда зажигается подсветка Кремля, из окна открывается особенно волшебный вид.',3800.00,'pols/images/hotels/Moscow/hotel_1/1/(1).webp','pols/images/hotels/Moscow/hotel_1/1/(2).webp','pols/images/hotels/Moscow/hotel_1/1/(3).webp',5),(21,'Номер с видом на Кремль',2,1,24,'Главная особенность этого номера - бесподобный вид на башни Кремля, который открывается прямо из кровати. Утром можно наблюдать, как первые лучи солнца золотят купола соборов, а вечером - как включается праздничная подсветка. Интерьер выдержан в благородных бордово-золотых тонах.',5500.00,'pols/images/hotels/Moscow/hotel_1/2/(1).webp','pols/images/hotels/Moscow/hotel_1/2/(2).webp','pols/images/hotels/Moscow/hotel_1/2/(3).webp',5),(22,'Бизнес люкс',2,2,34,'Просторный номер с полноценной рабочей зоной и панорамным видом на Москва-Сити. Интерьер в стиле contemporary с элементами хай-тека: глянцевые поверхности, встроенная подсветка, эргономичная мебель. Особый комфорт создает система \"умного дома\", управляющая климатом и освещением.',7200.00,'pols/images/hotels/Moscow/hotel_1/3/(1).webp','pols/images/hotels/Moscow/hotel_1/3/(2).webp','pols/images/hotels/Moscow/hotel_1/3/(3).webp',5),(23,'Апартаменты с кухней',3,2,40,'Просторные апартаменты с полноценной кухней и обеденной зоной - идеальное решение для длительного проживания. Интерьер в скандинавском стиле: светлое дерево, минималистичная мебель, панорамные окна. Из гостиной открывается вид на храм Василия Блаженного - как живая открытка Москвы.',7800.00,'pols/images/hotels/Moscow/hotel_1/4/(1).webp','pols/images/hotels/Moscow/hotel_1/4/(2).webp','pols/images/hotels/Moscow/hotel_1/4/(3).webp',5),(24,'Президентский люкс',4,3,55,'Роскошные апартаменты на верхнем этаже с панорамным остеклением по всему периметру. Здесь можно одновременно видеть и Кремль, и Москва-Сити - вся столица как на ладони. Интерьер в стиле ар-деко с хрустальными люстрами, мраморными поверхностями и антикварными деталями.',9500.00,'pols/images/hotels/Moscow/hotel_1/5/(1).webp','pols/images/hotels/Moscow/hotel_1/5/(2).webp','pols/images/hotels/Moscow/hotel_1/5/(3).webp',5),(25,'Стандарт городской вид',1,1,16,'Современный номер с панорамными окнами, откуда открывается вид на оживленные московские улицы. Интерьер в серо-бежевой гамме с яркими акцентами создает ощущение динамики. Особый шарм придает система освещения, которая позволяет менять атмосферу от рабочей до расслабляющей.',3200.00,'pols/images/hotels/Moscow/hotel_2/1/(1).webp','pols/images/hotels/Moscow/hotel_2/1/(2).webp','pols/images/hotels/Moscow/hotel_2/1/(3).webp',6),(26,'Номер с балконом',2,1,22,'Номер с просторным балконом, где можно провести утро с кофе или вечер с бокалом вина, наблюдая за жизнью Садового кольца. Интерьер в стиле лофт с кирпичными стенами и деревянными балками создает атмосферу городского шика.',4700.00,'pols/images/hotels/Moscow/hotel_2/2/(1).webp','pols/images/hotels/Moscow/hotel_2/2/(2).webp','pols/images/hotels/Moscow/hotel_2/2/(3).webp',6),(27,'Арт-люкс',2,1,28,'Уникальный номер, где каждый элемент - от мебели до светильников - является произведением искусства. На стенах - работы современных российских художников, в углу - скульптурная композиция. Вид на исторические особняки дополняет творческую атмосферу.',6300.00,'pols/images/hotels/Moscow/hotel_2/3/(1).webp','pols/images/hotels/Moscow/hotel_2/3/(2).webp','pols/images/hotels/Moscow/hotel_2/3/(3).webp',6),(28,'Номер с камином',1,1,20,'Романтический номер с настоящим камином, у которого так приятно проводить зимние вечера. Интерьер в английском стиле: кожаные кресла, дубовая мебель, клетчатые пледы. Вид на тихий внутренний двор с фонтаном создает ощущение уединения.',5200.00,'pols/images/hotels/Moscow/hotel_2/4/(1).webp','pols/images/hotels/Moscow/hotel_2/4/(2).webp','pols/images/hotels/Moscow/hotel_2/4/(3).webp',6),(29,'Пентхаус',3,2,45,'Двухуровневый пентхаус с террасой, откуда открывается панорамный вид на 360 градусов. На террасе - джакузи и зона отдыха с мягкими диванами. Интерьер в стиле modern luxury с элементами эклектики: современная мебель соседствует с винтажными находками.',8500.00,'pols/images/hotels/Moscow/hotel_2/5/(1).webp','pols/images/hotels/Moscow/hotel_2/5/(2).webp','pols/images/hotels/Moscow/hotel_2/5/(3).webp',6),(30,'Стандарт в татарском стиле',1,1,15,'Номер, где традиционные татарские орнаменты переплетаются с современным дизайном. Стены украшены изящной резьбой по дереву, текстиль выполнен в национальных мотивах. Окна выходят на тихий внутренний двор с фонтаном в восточном стиле.',1800.00,'pols/images/hotels/Kazan/hotel_1/1/(1).webp','pols/images/hotels/Kazan/hotel_1/1/(2).webp','pols/images/hotels/Kazan/hotel_1/1/(3).webp',7),(31,'Улучшенный двухместный',2,1,20,'Просторный номер с элементами татарского декора: вышитые подушки, медная посуда на полках, традиционные узоры на коврах. Из окон открывается вид на старый город, где смешались восточная и европейская архитектура.',3200.00,'pols/images/hotels/Kazan/hotel_1/2/(1).webp','pols/images/hotels/Kazan/hotel_1/2/(2).webp','pols/images/hotels/Kazan/hotel_1/2/(3).webp',7),(32,'Люкс \"Ханская ставка\"',2,1,28,'Роскошный номер, вдохновленный интерьерами ханских дворцов: балдахин над кроватью, низкие диваны с шелковыми подушками, медные светильники. Отдельная чайная зона с набором традиционных сладостей создает атмосферу восточного гостеприимства.',4500.00,'pols/images/hotels/Kazan/hotel_1/3/(1).webp','pols/images/hotels/Kazan/hotel_1/3/(2).webp','pols/images/hotels/Kazan/hotel_1/3/(3).webp',7),(33,'Семейный номер',3,1,32,'Просторный номер для семьи с детьми, где традиционные татарские мотивы сочетаются с современным комфортом. Детский уголок с национальными игрушками и книжками, удобные кровати с ортопедическими матрасами. Вид на мечеть Кул-Шариф добавляет национального колорита.',3800.00,'pols/images/hotels/Kazan/hotel_1/4/(1).webp','pols/images/hotels/Kazan/hotel_1/4/(2).webp','pols/images/hotels/Kazan/hotel_1/4/(3).webp',7),(34,'Апартаменты \"Тюбетейка\"',4,2,40,'Уникальные двухуровневые апартаменты, форма которых повторяет традиционную татарскую тюбетейку. На первом уровне - гостиная с чайной зоной и собственной сауной, на втором - спальни с круглыми окнами, напоминающими иллюминаторы.',5800.00,'pols/images/hotels/Kazan/hotel_1/5/(1).webp','pols/images/hotels/Kazan/hotel_1/5/(2).webp','pols/images/hotels/Kazan/hotel_1/5/(3).webp',7),(35,'Стандарт с речным видом',1,1,18,'Номер с панорамным окном, откуда открывается бескрайний вид на Волгу. Интерьер в морском стиле: сине-белые тона, деревянные панели, светильники в форме волн. Особый шарм придают детали - модели кораблей на полках, морские карты на стенах.',2900.00,'pols/images/hotels/Kazan/hotel_2/1/(1).webp','pols/images/hotels/Kazan/hotel_2/1/(2).webp','pols/images/hotels/Kazan/hotel_2/1/(3).webp',8),(36,'Кают-компания',2,1,24,'Номер, оформленный как каюта речного лайнера: круглые иллюминаторы, деревянные панели, компактная функциональная мебель. Из окон открывается вид на речной порт, где швартуются прогулочные теплоходы. Вечером особенно приятно наблюдать за огнями судов на воде.',4100.00,'pols/images/hotels/Kazan/hotel_2/2/(1).webp','pols/images/hotels/Kazan/hotel_2/2/(2).webp','pols/images/hotels/Kazan/hotel_2/2/(3).webp',8),(37,'Люкс \"Капитанский мостик\"',2,2,35,'Двухуровневый номер, напоминающий капитанский мостик корабля. На верхнем уровне - спальня с панорамным остеклением, откуда видно слияние Волги и Казанки. Ванная комната с гидромассажной ванной оформлена как корабельная купальня с медными элементами.',6500.00,'pols/images/hotels/Kazan/hotel_2/3/(1).webp','pols/images/hotels/Kazan/hotel_2/3/(2).webp','pols/images/hotels/Kazan/hotel_2/3/(3).webp',8),(38,'Номер с балконом',1,1,20,'Номер с просторным балконом, где можно провести весь вечер, наблюдая за закатом над Волгой. Интерьер в светлых тонах с морскими акцентами: канатные элементы, синий текстиль, фотографии старинных пароходов.',4800.00,'pols/images/hotels/Kazan/hotel_2/4/(1).webp','pols/images/hotels/Kazan/hotel_2/4/(2).webp','pols/images/hotels/Kazan/hotel_2/4/(3).webp',8),(39,'Президентская палуба',4,2,45,'Роскошный люкс на верхнем этаже, оформленный как капитанская каюта премиум-класса. Собственная терраса с джакузи и зоной отдыха, откуда открывается вид на весь город и реку. Интерьер сочетает морскую романтику с современным комфортом.',7500.00,'pols/images/hotels/Kazan/hotel_2/5/(1).webp','pols/images/hotels/Kazan/hotel_2/5/(2).webp','pols/images/hotels/Kazan/hotel_2/5/(3).webp',8),(40,'Стандарт у моря',1,1,16,'Яркий номер в средиземноморском стиле: белые стены, голубые акценты, плетеная мебель. С балкона открывается безграничный вид на море - утром можно наблюдать, как рыбацкие лодки выходят в море, а вечером - как зажигаются огни набережной.',3100.00,'pols/images/hotels/Anapa/hotel_1/1/(1).webp','pols/images/hotels/Anapa/hotel_1/1/(2).webp','pols/images/hotels/Anapa/hotel_1/1/(3).webp',9),(41,'Семейный с детской зоной',3,1,28,'Просторный номер, где продумано все для комфортного семейного отдыха: игровая зона с игрушками и книжками, удобные кровати с ортопедическими матрасами, балкон с видом на аквапарк. Интерьер в светлых тонах с яркими деталями создает радостную атмосферу.',4200.00,'pols/images/hotels/Anapa/hotel_1/2/(1).webp','pols/images/hotels/Anapa/hotel_1/2/(2).webp','pols/images/hotels/Anapa/hotel_1/2/(3).webp',9),(42,'Номер с гидромассажем',2,1,22,'Романтический номер с гидромассажной ванной на балконе, откуда открывается вид на море. Интерьер в бежево-коричневых тонах с мягким освещением создает атмосферу уюта. Особый шарм придают детали - свечи в подсвечниках, живые цветы, пледы из натуральной шерсти.',5200.00,'pols/images/hotels/Anapa/hotel_1/3/(1).webp','pols/images/hotels/Anapa/hotel_1/3/(2).webp','pols/images/hotels/Anapa/hotel_1/3/(3).webp',9),(43,'Бунгало у пляжа',2,1,25,'Уединенное бунгало в тропическом саду с прямым выходом к пляжу. Интерьер в колониальном стиле: темное дерево, белые ткани, плетеные элементы. Собственная терраса с шезлонгами и открытая ванная комната создают ощущение полного единения с природой.',5800.00,'pols/images/hotels/Anapa/hotel_1/4/(1).webp','pols/images/hotels/Anapa/hotel_1/4/(2).webp','pols/images/hotels/Anapa/hotel_1/4/(3).webp',9),(44,'Эконом с садовым видом',1,0,15,'Небольшой уютный номер с видом на цветущий сад отеля. Простые деревянные полы, светлые стены, минималистичная мебель - все создает ощущение легкости и свободы. Идеальный вариант для тех, кто ценит простоту и проводит весь день на море.',1800.00,'pols/images/hotels/Anapa/hotel_2/1/(1).webp','pols/images/hotels/Anapa/hotel_2/1/(2).webp','pols/images/hotels/Anapa/hotel_2/1/(3).webp',10),(45,'Стандарт с балконом',2,1,20,'Светлый номер с балконом, откуда открывается вид на море. Интерьер в средиземноморском стиле: белые стены, голубой текстиль, деревянная мебель. По утрам на балконе можно встретить рассвет с чашкой кофе, а вечером - слушать шум прибоя.',3500.00,'pols/images/hotels/Anapa/hotel_2/2/(1).webp','pols/images/hotels/Anapa/hotel_2/2/(2).webp','pols/images/hotels/Anapa/hotel_2/2/(3).webp',10),(46,'Семейный номер',3,1,30,'Просторный номер для семьи с детьми, где продумана каждая деталь: двухъярусная кровать для детей, игровая зона с игрушками, балкон с видом на парковую зону. Интерьер в светлых тонах с яркими акцентами создает радостную атмосферу.',3800.00,'pols/images/hotels/Anapa/hotel_2/3/(1).webp','pols/images/hotels/Anapa/hotel_2/3/(2).webp','pols/images/hotels/Anapa/hotel_2/3/(3).webp',10),(47,'Номер \"Романтика\"',1,1,18,'Уютный номер с балдахином над кроватью и мягким приглушенным освещением. Интерьер в пастельных тонах с романтичными деталями: свечи, живые цветы, шелковый текстиль. Вид на сад с цветущими розами добавляет шарма.',4500.00,'pols/images/hotels/Anapa/hotel_2/4/(1).webp','pols/images/hotels/Anapa/hotel_2/4/(2).webp','pols/images/hotels/Anapa/hotel_2/4/(3).webp',10),(48,'Люкс с террасой',2,1,25,'Номер с просторной террасой, где можно проводить все свободное время: завтракать, загорать на шезлонгах, любоваться закатом. Интерьер в светлых тонах с морскими акцентами создает ощущение легкости и свободы.',5200.00,'pols/images/hotels/Anapa/hotel_2/5/(1).webp','pols/images/hotels/Anapa/hotel_2/5/(2).webp','pols/images/hotels/Anapa/hotel_2/5/(3).webp',10),(49,'Бизнес стандарт',1,1,18,'Функциональный номер для деловых поездок с просторной рабочей зоной и панорамным видом на деловой центр города. Интерьер в строгих серых тонах с хромированными деталями создает рабочую атмосферу, а удобное кресло и хорошее освещение помогают сосредоточиться.',3200.00,'pols/images/hotels/Rostov_Na_Donu/hotel_1/1/(1).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/1/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/1/(3).webp',11),(50,'Улучшенный двухместный',2,1,24,'Просторный номер с двумя удобными кроватями и зоной для неформальных встреч. Интерьер в коричнево-бежевой гамме с деревянными панелями создает атмосферу стабильности и комфорта. Большие окна с видом на город наполняют пространство светом.',4500.00,'pols/images/hotels/Rostov_Na_Donu/hotel_1/2/(1).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/2/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/2/(3).webp',11),(51,'Люкс \"Донской\"',2,2,35,'Роскошный люкс в казачьем стиле с антикварной мебелью и традиционными элементами декора: старинное оружие на стенах, кованые светильники, кожаные диваны. Отдельная гостиная зона с камином создает атмосферу южного гостеприимства.',6800.00,'pols/images/hotels/Rostov_Na_Donu/hotel_1/3/(1).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/3/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/3/(3).webp',11),(52,'Номер с кабинетом',1,1,22,'Номер с полноценным рабочим кабинетом, отделенным стеклянной перегородкой. Интерьер в темных тонах с деревянной отделкой создает деловую атмосферу. Вид на парк позволяет отвлечься и перевести дух во время напряженного рабочего дня.',5200.00,'pols/images/hotels/Rostov_Na_Donu/hotel_1/4/(1).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/4/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/4/(3).webp',11),(53,'Президентский люкс',3,2,45,'Эксклюзивные апартаменты с панорамным видом на весь город. Интерьер сочетает современный дизайн с элементами классики: мраморные поверхности, хрустальные люстры, кожаная мебель. Персональный сервис и внимание к деталям делают проживание по-настоящему VIP.',8000.00,'pols/images/hotels/Rostov_Na_Donu/hotel_1/5/(1).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/5/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_1/5/(3).webp',11),(54,'Стандарт речной вид',1,1,16,'Уютный номер с видом на широкую гладь Дона. Интерьер в казачьем стиле: деревянные полы, вышитые подушки, медная посуда на полках. По вечерам можно наблюдать, как закатное солнце окрашивает воду в золотые оттенки.',2800.00,'pols/images/hotels/Rostov_Na_Donu/hotel_2/1/(1).png','pols/images/hotels/Rostov_Na_Donu/hotel_2/1/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/1/(3).webp',12),(55,'Номер \"Казачья станица\"',2,1,22,'Номер, стилизованный под традиционную казачью хату: беленые стены, деревянные лавки, сундук вместо тумбочки. Современный комфорт гармонично сочетается с этническими элементами. Вид на набережную добавляет атмосферности.',3800.00,'pols/images/hotels/Rostov_Na_Donu/hotel_2/2/(1).jpg','pols/images/hotels/Rostov_Na_Donu/hotel_2/2/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/2/(3).png',12),(56,'Люкс с камином',2,1,28,'Романтический номер с настоящим камином, у которого так приятно проводить зимние вечера. Интерьер в стиле казачьего куреня: кованая кровать с балдахином, шкуры на полу, медная посуда на полках. Вид на реку дополняет атмосферу.',5500.00,'pols/images/hotels/Rostov_Na_Donu/hotel_2/3/(1).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/3/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/3/(3).webp',12),(57,'Семейный номер',3,1,32,'Просторный номер для семьи с детьми, где традиционные казачьи мотивы сочетаются с современным комфортом. Детский уголок с народными игрушками, удобные кровати с ортопедическими матрасами. Вид на парк позволяет отдохнуть от городской суеты.',4200.00,'pols/images/hotels/Rostov_Na_Donu/hotel_2/4/(1).png','pols/images/hotels/Rostov_Na_Donu/hotel_2/4/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/4/(3).webp',12),(58,'Атаманский люкс',4,2,40,'Роскошный люкс, напоминающий атаманские покои: массивная дубовая мебель, кованые элементы, шкуры на полу. Собственная сауна с дубовыми полками и чайная комната с самоваром создают атмосферу настоящего казачьего гостеприимства.',7200.00,'pols/images/hotels/Rostov_Na_Donu/hotel_2/5/(1).png','pols/images/hotels/Rostov_Na_Donu/hotel_2/5/(2).webp','pols/images/hotels/Rostov_Na_Donu/hotel_2/5/(3).webp',12),(59,'Стандарт исторический',1,1,15,'Номер в здании XIX века с сохраненными историческими деталями: высокие потолки с лепниной, дубовый паркет, старинные двери. Вид на старый город переносит в прошлое, а современные удобства делают проживание комфортным.',2500.00,'pols/images/hotels/Nizhny_Novgorod/hotel_1/1/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/1/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/1/(3).webp',13),(60,'Номер с видом на Стрелку',2,1,20,'Номер с панорамным окном, откуда открывается захватывающий вид на место слияния Оки и Волги. Интерьер в морском стиле: синие акценты, деревянные панели, фотографии старинных судов. Особый шарм придает кресло-качалка у окна.',3800.00,'pols/images/hotels/Nizhny_Novgorod/hotel_1/2/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/2/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/2/(3).webp',13),(61,'Люкс \"Купеческий\"',2,1,30,'Роскошный номер в стиле купеческого особняка: дубовая мебель с резьбой, хрустальные люстры, тяжелые портьеры. Вид на набережную и старинные склады напоминает о богатой истории города как крупного торгового центра.',5800.00,'pols/images/hotels/Nizhny_Novgorod/hotel_1/3/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/3/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/3/(3).webp',13),(62,'Номер с балконом',1,1,18,'Номер с небольшим балконом, откуда открывается вид на исторические здания старого города. Интерьер в стиле русской усадьбы: деревянные стены, вышитые подушки, медный самовар в углу. Идеальное место для утреннего чаепития.',4200.00,'pols/images/hotels/Nizhny_Novgorod/hotel_1/4/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/4/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_1/4/(3).webp',13),(63,'Стандарт городской',1,1,16,'Современный номер с панорамным окном и видом на оживленные улицы города. Интерьер в серо-бежевой гамме с хромированными деталями создает атмосферу динамичного мегаполиса. Умная система управления освещением позволяет менять настроение пространства.',3200.00,'pols/images/hotels/Nizhny_Novgorod/hotel_2/1/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/1/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/1/(3).webp',14),(64,'Номер с видом на реку',2,1,22,'Номер с панорамным окном, откуда открывается безграничный вид на Волгу. Интерьер в морском стиле: белые стены, синие акценты, деревянные панели. Особый шарм придает кресло-качалка у окна, где можно наблюдать за проплывающими судами.',4800.00,'pols/images/hotels/Nizhny_Novgorod/hotel_2/2/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/2/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/2/(3).webp',14),(65,'Бизнес люкс',2,2,35,'Просторный номер с отдельной рабочей зоной и конференц-столом. Интерьер в строгих коричневых тонах с кожаной мебелью создает деловую атмосферу. Вид на слияние двух рек напоминает о важном торговом значении города в прошлом и настоящем.',6800.00,'pols/images/hotels/Nizhny_Novgorod/hotel_2/3/(1).png','pols/images/hotels/Nizhny_Novgorod/hotel_2/3/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/3/(2).webp',14),(66,'Номер \"Небесный\"',1,1,20,'Номер на верхнем этаже с панорамным остеклением, откуда открывается вид на 360 градусов. Интерьер в бело-голубых тонах создает ощущение полета. Кровать с регулируемым основанием позволяет найти идеальное положение для отдыха и созерцания.',5500.00,'pols/images/hotels/Nizhny_Novgorod/hotel_2/4/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/4/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/4/(3).webp',14),(67,'Пентхаус \"Облака\"',4,2,50,'Двухуровневый пентхаус с террасой, джакузи и зоной барбекю. Интерьер в стиле лофт с элементами хай-тека: открытые коммуникации, стеклянные перегородки, современная мебель. Вид на весь город и реки особенно впечатляет ночью, когда зажигаются огни.',8500.00,'pols/images/hotels/Nizhny_Novgorod/hotel_2/5/(1).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/5/(2).webp','pols/images/hotels/Nizhny_Novgorod/hotel_2/5/(3).webp',14),(68,'Стандарт у моря',1,1,16,'Яркий номер в средиземноморском стиле: белые стены, голубые акценты, плетеная мебель. С балкона открывается безграничный вид на бухту - утром можно наблюдать, как рыбацкие лодки выходят в море, а вечером - как зажигаются огни набережной.',3500.00,'pols/images/hotels/Gelendzhik/hotel_1/1/(1).webp','pols/images/hotels/Gelendzhik/hotel_1/1/(2).webp','pols/images/hotels/Gelendzhik/hotel_1/1/(3).webp',15),(69,'Номер \"Романтика\"',1,1,18,'Уютный номер с балдахином над кроватью и мягким приглушенным освещением. Интерьер в пастельных тонах с романтичными деталями: свечи, живые цветы, шелковый текстиль. Вид на море и закаты создает неповторимую атмосферу.',4800.00,'pols/images/hotels/Gelendzhik/hotel_1/2/(1).webp','pols/images/hotels/Gelendzhik/hotel_1/2/(2).webp','pols/images/hotels/Gelendzhik/hotel_1/2/(3).webp',15),(70,'Семейный бунгало',3,1,30,'Отдельное бунгало в тропическом саду с детской игровой зоной. Интерьер в светлых тонах с яркими акцентами создает радостную атмосферу. Собственная терраса с мебелью позволяет проводить время на свежем воздухе, не выходя из номера.',5200.00,'pols/images/hotels/Gelendzhik/hotel_1/3/(1).webp','pols/images/hotels/Gelendzhik/hotel_1/3/(2).webp','pols/images/hotels/Gelendzhik/hotel_1/3/(3).webp',15),(71,'Люкс с джакузи',2,1,25,'Романтический номер с гидромассажной ванной на террасе, откуда открывается панорамный вид на море. Интерьер в теплых бежево-коричневых тонах с мягким освещением создает атмосферу уюта. Особый шарм придают детали - свечи, пледы из натуральной шерсти.',6200.00,'pols/images/hotels/Gelendzhik/hotel_1/4/(1).webp','pols/images/hotels/Gelendzhik/hotel_1/4/(2).webp','pols/images/hotels/Gelendzhik/hotel_1/4/(3).webp',15),(72,'Вилла \"Морская\"',4,2,45,'Двухуровневая вилла с частным бассейном и прямым выходом к пляжу. Интерьер в средиземноморском стиле: белые стены, деревянные потолки, текстиль в морских тонах. Панорамные окна открывают вид на бухту и горы.',7800.00,'pols/images/hotels/Gelendzhik/hotel_1/5/(1).webp','pols/images/hotels/Gelendzhik/hotel_1/5/(2).webp','pols/images/hotels/Gelendzhik/hotel_1/5/(3).webp',15),(73,'Эконом садовый',1,0,15,'Небольшой уютный номер с видом на цветущий сад отеля. Простые деревянные полы, светлые стены, минималистичная мебель - все создает ощущение легкости и свободы. Идеальный вариант для тех, кто ценит простоту и проводит весь день на море.',1900.00,'pols/images/hotels/Gelendzhik/hotel_2/1/(1).webp','pols/images/hotels/Gelendzhik/hotel_2/1/(2).webp','pols/images/hotels/Gelendzhik/hotel_2/1/(3).webp',16),(74,'Стандарт с балконом',2,1,20,'Светлый номер с балконом, откуда открывается вид на море. Интерьер в средиземноморском стиле: белые стены, голубой текстиль, деревянная мебель. По утрам на балконе можно встретить рассвет с чашкой кофе, а вечером - слушать шум прибоя.',3800.00,'pols/images/hotels/Gelendzhik/hotel_2/2/(1).webp','pols/images/hotels/Gelendzhik/hotel_2/2/(2).webp','pols/images/hotels/Gelendzhik/hotel_2/2/(3).webp',16),(75,'Номер \"Прованс\"',1,1,18,'Номер в стиле французского прованса: лавандовые оттенки, деревенская мебель, цветочные принты. Небольшой балкончик с видом на сад создает ощущение уюта и безмятежности. Особый шарм придают детали - сушеные травы в вазах, плетеные корзины.',4500.00,'pols/images/hotels/Gelendzhik/hotel_2/3/(1).webp','pols/images/hotels/Gelendzhik/hotel_2/3/(2).webp','pols/images/hotels/Gelendzhik/hotel_2/3/(3).webp',16),(76,'Семейный номер',3,1,32,'Просторный номер для семьи с детьми, где продумана каждая деталь: двухъярусная кровать для детей, игровая зона с игрушками, балкон с видом на парковую зону. Интерьер в светлых тонах с яркими акцентами создает радостную атмосферу.',4200.00,'pols/images/hotels/Gelendzhik/hotel_2/4/(1).webp','pols/images/hotels/Gelendzhik/hotel_2/4/(2).webp','pols/images/hotels/Gelendzhik/hotel_2/4/(3).webp',16);
